// import React, {useState} from "react";
import React from "react";

function Search({search, onSearchChange}) {


  function handleSearchChange(event) {
    // we could pass up the whole event object via onSearchChange
    // but passing *only* the value makes the data easier to work with in the parent
    onSearchChange(event.target.value);
  }

  // const transToDisplay = trans.filter((tran) => {
  //   if (typedSearch === "All"){
  //     return true;
  //   }
  //   return tran.category === typedSearch;
  // });
  return (
    <div className="ui large fluid icon input">
      <input
        type="text"
        placeholder="Search your Recent Transactions"
        //onChange={() => console.log("Searching...")}
        value={search} 
        onChange={handleSearchChange}
      />
      <i className="circular search link icon" ></i>
    </div>
  );
}

export default Search;
